    <h1 align=left style='margin-top:12.0pt;margin-right:0cm;margin-bottom:

    name="_Toc189487040"><![if !supportLists]><b><span lang=EN-US
    style='font-size:12.0pt;mso-bidi-font-size:16.0pt;font-family:"Arial",sans-serif;
    mso-fareast-font-family:Arial;font-variant:normal !important;mso-font-kerning:
    16.0pt;mso-ansi-language:EN-US;mso-fareast-language:AR-SA;mso-no-proof:
    no'><span style='mso-list:Ignore'>11.<span style='font:7.0pt "Times New Roman"'>
    </span></span></span></b><![endif]><b><span lang=EN-US style='font-size:
    12.0pt;mso-bidi-font-size:16.0pt;font-family:"Arial",sans-serif;mso-fareast-font-family:
    "Times New Roman";font-variant:normal !important;mso-font-kerning:16.0pt;
    mso-ansi-language:EN-US;mso-fareast-language:AR-SA;mso-no-proof:no'>PRESENTATION
    OF THE SYSTEM AND ACCESSORIES</span></b></a><b><span lang=EN-US
    style='font-size:12.0pt;mso-bidi-font-size:16.0pt;font-family:"Arial",sans-serif;
    mso-fareast-font-family:"Times New Roman";font-variant:normal !important;
    mso-font-kerning:16.0pt;mso-ansi-language:EN-US;mso-fareast-language:AR-SA;
    mso-no-proof:no'><o:p></o:p></span></b></h1>
    <p class=MsoNormal style='text-align:justify'><span lang=EN-US
    style='font-size:12.0pt;font-family:"Arial",sans-serif;mso-ansi-language:
    EN-US'>In this work, a system composed of several sensors and actuators is
    presented, which allow generating and controlling the temperature
    conditions inside a container. The objective is to obtain stable thermal
    cycles (temperature versus time curves) so that it is possible to test
    conformance of sensor temperature ranges in respect to their data sheets,
    before performing an experiment. The system was designed to obtain data of
    real conditions within closed spaces, and then compare them with results
    obtained in larger spaces and thus establish their proportionality
    relationship. <o:p></o:p></span></p>
    <p class=MsoNormal style='mso-margin-top-alt:auto;mso-margin-bottom-alt:
    auto'><span lang=EN-US style='font-size:12.0pt;mso-bidi-font-size:11.0pt;
    font-family:"Calibri",sans-serif;mso-ascii-theme-font:minor-latin;

    4.5pt;mso-bevel-captop-dpiheight:3.0pt;mso-bevel-capbot-bevelstyle:0;
    mso-bevel-capbot-dpiwidth:0pt;mso-bevel-capbot-dpiheight:0pt;mso-bevel-material:
    8;mso-bevel-dpiextrusion:4.5pt;mso-bevel-dpicontour:0pt;mso-ansi-language:
    EN-US'><o:p>&nbsp;</o:p></span></p>

    <p class=papertitle style='mso-margin-top-alt:auto;mso-margin-bottom-alt:
    auto;text-align:justify'><span lang=EN-US style='font-size:12.0pt;
    font-family:"Arial",sans-serif'>Before making the physical model it is
    necessary to present a little the idea with some implements that are
    available, to see the feasibility and see if the realization would be
    possible, it is like a small materialization of the idea, to then produce
    the physical model comprises several aspects of utmost importance: the
    first consists of finding the dynamic characteristics of the system
    according to mathematical theory, in a case like this it is necessary to
    model the thermal system first, then follow the experimental developments
    and obtain the values &#8203;&#8203;&#8203;&#8203;of the previous tables of
    the system or the plant; to then make approximations under valid criteria
    that simplify the result obtained.<o:p></o:p></span></p>

    <p class=MsoNormal style='text-align:justify;line-height:115%'><span
    lang=EN-US style='font-size:12.0pt;line-height:115%;font-family:"Arial",sans-serif;
    mso-fareast-font-family:"MS Mincho";mso-ansi-language:EN-US;mso-no-proof:
    no'>In summary, our system is a closed system with a transient flow of air
    and energy, managed by solenoid valves that open and close the system, to
    exchange energy and water vapor.<o:p></o:p></span></p>
    <p class=MsoListParagraphCxSpFirst style='margin-left:0cm;mso-add-space:
    auto;text-align:justify;line-height:115%'><span lang=EN-US
    style='font-size:12.0pt;line-height:115%;font-family:"Arial",sans-serif'><o:p>&nbsp;</o:p></span></p>
    <p class=MsoListParagraphCxSpLast style='margin-left:0cm;mso-add-space:
    auto;text-align:justify;line-height:115%'><span lang=EN-US
    style='font-size:12.0pt;line-height:115%;font-family:"Arial",sans-serif'>For
    the initial state, the constant volume of the container is considered as
    known, the medium will be air because variables such as density,
    temperature and humidity are equal inside and outside the chamber in the
    first interval from room temperature to 60 °C. The 5 watts electric heating
    element (Ra) is the actuator in this temperature zone, then the 150-watt
    electric heating element to heat the systems up to 200°C and finally the
    cooling effect (<span class=SpellE>Rc</span>). It is better to let the
    system start from rest at room temperature, using equation 1, <b
    style='mso-bidi-font-weight:normal'>[17].<o:p></o:p></b></span></p>
    <p class=MsoNormal><![if gte msEquation 12]><m:oMath><b style='mso-bidi-font-weight:
     normal'><i style='mso-bidi-font-style:normal'><span style='font-size:12.0pt;

    <h1 align=left style='margin-top:12.0pt;margin-right:0cm;margin-bottom:

    </span></span></span></b><![endif]><b><span lang=ES style='font-size:12.0pt;
    mso-bidi-font-size:16.0pt;font-family:"Arial",sans-serif;mso-fareast-font-family:
    "Times New Roman";font-variant:normal !important;mso-font-kerning:16.0pt;
    mso-ansi-language:ES;mso-fareast-language:AR-SA;mso-no-proof:no'>TESTING
    AND VALIDATION</span></b></a><b><span lang=ES style='font-size:12.0pt;
    mso-bidi-font-size:16.0pt;font-family:"Arial",sans-serif;mso-fareast-font-family:
    "Times New Roman";font-variant:normal !important;mso-font-kerning:16.0pt;
    mso-ansi-language:ES;mso-fareast-language:AR-SA;mso-no-proof:no'><o:p></o:p></span></b></h1>
    <p class=MsoListParagraphCxSpFirst style='margin-top:12.0pt;margin-right:
    0cm;margin-bottom:10.0pt;margin-left:18.0pt;mso-add-space:auto;text-align:
    justify;text-indent:-18.0pt;line-height:115%;mso-list:l8 level1 lfo7'><![if !supportLists]><span
    lang=EN-US style='font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:
    115%;font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:
    Symbol'><span style='mso-list:Ignore'>·<span style='font:7.0pt "Times New Roman"'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span></span></span><![endif]><span lang=EN-US style='font-size:12.0pt;
    mso-bidi-font-size:11.0pt;line-height:115%;font-family:"Arial",sans-serif'>The
    set of data obtained experimentally in this work, can serve as a benchmark
    in optimization processes of closed loop control algorithms in closed
    chamber thermal application systems, which includes a wide variety of
    thermal processes.<o:p></o:p></span></p>
    <p class=MsoListParagraphCxSpMiddle style='margin-top:0cm;margin-right:
    0cm;margin-bottom:10.0pt;margin-left:18.0pt;mso-add-space:auto;text-align:
    justify;text-indent:-18.0pt;line-height:115%;mso-list:l8 level1 lfo7'><![if !supportLists]><span
    lang=EN-US style='font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:
    115%;font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:
    Symbol'><span style='mso-list:Ignore'>·<span style='font:7.0pt "Times New Roman"'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span></span></span><![endif]><span lang=EN-US style='font-size:12.0pt;
    mso-bidi-font-size:11.0pt;line-height:115%;font-family:"Arial",sans-serif'>The
    three mathematical models can be used in a wide range of applications, even
    in larger volumes but preserving the same geometry, because in the system
    includes the losses by enclosures, infiltrations of air, and losses by
    isolation; this allows to keep the system stable, scalable, easy
    installation and affordable.<o:p></o:p></span></p>
    <p class=MsoListParagraphCxSpMiddle style='margin-top:0cm;margin-right:
    0cm;margin-bottom:10.0pt;margin-left:18.0pt;mso-add-space:auto;text-align:
    justify;text-indent:-18.0pt;line-height:115%;mso-list:l1 level1 lfo6'><![if !supportLists]><span
    lang=EN-US style='font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:
    115%;font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:
    Symbol'><span style='mso-list:Ignore'>·<span style='font:7.0pt "Times New Roman"'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span></span></span><![endif]><span lang=EN-US style='font-size:12.0pt;
    mso-bidi-font-size:11.0pt;line-height:115%;font-family:"Arial",sans-serif'>The
    calibration curves of this work can be compared with systems that have the
    same thermal behavior, the same geometry and volume scalability. When
    comparing the data of this experiment with those of a new system that is built
    with actuators and sensors of similar characteristics, it will be possible
    to establish relationships between the proposed model and the new data,
    according to the measurement scale.<o:p></o:p></span></p>
    <p class=MsoListParagraphCxSpMiddle style='margin-top:0cm;margin-right:
    0cm;margin-bottom:10.0pt;margin-left:18.0pt;mso-add-space:auto;text-align:

    <h1 align=left style='margin-top:12.0pt;margin-right:0cm;margin-bottom:

    name="_Toc189487048"></a><a name="_FIRMWARE_ELECTRONIC_DEVELOPMENT"></a><![if !supportLists]><span
    style='mso-bookmark:_Toc189487048'><b><span lang=ES style='font-size:12.0pt;
    mso-bidi-font-size:16.0pt;font-family:"Arial",sans-serif;mso-fareast-font-family:
    Arial;font-variant:normal !important;mso-font-kerning:16.0pt;mso-ansi-language:
    ES;mso-fareast-language:AR-SA;mso-no-proof:no'><span style='mso-list:Ignore'>6.<span
    style='font:7.0pt "Times New Roman"'>&nbsp;&nbsp;&nbsp; </span></span></span></b></span><![endif]><span
    style='mso-bookmark:_Toc189487048'><b><span lang=ES style='font-size:12.0pt;
    mso-bidi-font-size:16.0pt;font-family:"Arial",sans-serif;mso-fareast-font-family:
    "Times New Roman";font-variant:normal !important;mso-font-kerning:16.0pt;
    mso-ansi-language:ES;mso-fareast-language:AR-SA;mso-no-proof:no'>FIRMWARE
    ELECTRONIC DEVELOPMENT</span></b></span><b><span lang=ES style='font-size:
    12.0pt;mso-bidi-font-size:16.0pt;font-family:"Arial",sans-serif;mso-fareast-font-family:
    "Times New Roman";font-variant:normal !important;mso-font-kerning:16.0pt;
    mso-ansi-language:ES;mso-fareast-language:AR-SA;mso-no-proof:no'><o:p></o:p></span></b></h1>
    <p class=MsoNormal align=left style='text-align:left'><b style='mso-bidi-font-weight:
    normal'><span lang=EN-US style='font-size:12.0pt;font-family:"Arial",sans-serif;
    mso-ansi-language:EN-US'><o:p>&nbsp;</o:p></span></b></p>
    <p class=MsoNormal align=left style='text-align:left'><b style='mso-bidi-font-weight:
    normal'><span lang=EN-US style='font-size:12.0pt;font-family:"Arial",sans-serif;
    mso-ansi-language:EN-US'>The following is a piece of code, structure of the
    control system in Arduino:<o:p></o:p></span></b></p>
    <p class=MsoNormal align=left style='text-align:left;line-height:150%'><span
    lang=EN-US style='font-family:"Arial",sans-serif;mso-ansi-language:EN-US'>//::::::::<span
    style='mso-spacerun:yes'>  </span>PID CONTROL DEFINITIONS<span
    style='mso-spacerun:yes'>  
    </span>:::::::::::::::::::::::::::::::::::::::::::// <o:p></o:p></span></p>
    <p class=MsoNormal align=left style='text-align:left;line-height:150%'><span
    lang=EN-US style='font-family:"Arial",sans-serif;mso-ansi-language:EN-US'>/**********<span
    style='mso-spacerun:yes'>   </span>actuator (Ra) resistance to 220 Vac<span
    style='mso-spacerun:yes'>  </span>************************************/<o:p></o:p></span></p>
    <p class=MsoNormal align=left style='text-align:left;line-height:150%'><span
    lang=EN-US style='font-family:"Arial",sans-serif;mso-ansi-language:EN-US'>/**********<span
    style='mso-spacerun:yes'>  </span>Ra: 48 ==&gt; to 220 Vac ==&gt;
    G(s)=4,94/(2,78S+1,72) ***************************/<o:p></o:p></span></p>
    <p class=MsoNormal align=left style='text-align:left;line-height:150%'><span
    lang=EN-US style='font-family:"Arial",sans-serif;mso-ansi-language:EN-US'>double
    Ra_Kp=0.4590, Ra_Ki=0.4805, Ra_Kd=-0.1539; //initial parameters, control
    arguments<o:p></o:p></span></p>
    <p class=MsoNormal align=left style='text-align:left;line-height:150%'><span
    lang=EN-US style='font-family:"Arial",sans-serif;mso-ansi-language:EN-US'>/************<span
    style='mso-spacerun:yes'>   </span>actuator (Rb) resistance to 12 Vdc<span
    style='mso-spacerun:yes'>  </span>*************************************/<o:p></o:p></span></p>
    <p class=MsoNormal align=left style='text-align:left;line-height:150%'><span
    lang=EN-US style='font-family:"Arial",sans-serif;mso-ansi-language:EN-US'>/**********<span
    style='mso-spacerun:yes'>  </span>Rb: 220 ==&gt; to 12 Vdc ==&gt;
    G(s)=4,94/(4,826S+0,583) ************************/<o:p></o:p></span></p>
    <p class=MsoNormal align=left style='text-align:left;line-height:150%'><span
    lang=EN-US style='font-family:"Arial",sans-serif;mso-ansi-language:EN-US'>double
    Rb_Kp=0.1556, Rb_Ki=0.0318, Rb_Kd=-0.2672; //initial parameters, control
    arguments<o:p></o:p></span></p>
    <p class=MsoNormal align=left style='text-align:left;line-height:150%'><span
    lang=EN-US style='font-family:"Arial",sans-serif;mso-ansi-language:EN-US'>/************<span
    style='mso-spacerun:yes'>   </span>actuator (Rc) Peltier cell at 12
    Vdc<span style='mso-spacerun:yes'> 
    </span>***********************************/<o:p></o:p></span></p>
    <p class=MsoNormal align=left style='text-align:left;line-height:150%'><span
    lang=EN-US style='font-family:"Arial",sans-serif;mso-ansi-language:EN-US'>/**********<span
    style='mso-spacerun:yes'>  </span>Rc: 1,98 ==&gt; to 12 Vdc ==&gt;
    G(s)=36/(12,42s+7,27) **************************/<o:p></o:p></span></p>
    <p class=MsoNormal align=left style='text-align:left;line-height:150%'><span
    lang=EN-US style='font-family:"Arial",sans-serif;mso-ansi-language:EN-US'>double
    Rc_Kp=0.2662, Rc_Ki=0.2637, Rc_Kd=-0.0943; //initial parameters, control
    arguments<o:p></o:p></span></p>
    <p class=MsoNormal align=left style='text-align:left;line-height:150%'><span
    lang=EN-US style='font-family:"Arial",sans-serif;mso-ansi-language:EN-US'>float
    temperature=0;<o:p></o:p></span></p>
    <p class=MsoNormal align=left style='text-align:left;line-height:150%'><span
    lang=EN-US style='font-family:"Arial",sans-serif;mso-ansi-language:EN-US'>unsigned
    long Resp_Last_Temp = 0;<o:p></o:p></span></p>
    <p class=MsoNormal align=left style='text-align:left;line-height:150%'><span
    lang=EN-US style='font-family:"Arial",sans-serif;mso-ansi-language:EN-US'>unsigned
    long Last_PID_Calc = 0;<o:p></o:p></span></p>
    <p class=MsoNormal align=left style='text-align:left;line-height:150%'><span
    lang=EN-US style='font-family:"Arial",sans-serif;mso-ansi-language:EN-US'>float
    Ant_Temp = -9999.0;<o:p></o:p></span></p>
    <p class=MsoNormal align=left style='text-align:left;line-height:150%'><span
    lang=EN-US style='font-family:"Arial",sans-serif;mso-ansi-language:EN-US'><o:p>&nbsp;</o:p></span></p>
    <p class=MsoNormal align=left style='text-align:left;line-height:150%'><span
    lang=EN-US style='font-family:"Arial",sans-serif;mso-ansi-language:EN-US'>PID
    myPID(&amp;Input, &amp;Output, &amp;Setpoint_Ra, Ra_Kp, Ra_Ki, Ra_Kd,
    DIRECT);<o:p></o:p></span></p>
    <p class=MsoNormal align=left style='text-align:left;line-height:150%'><span
    lang=EN-US style='font-family:"Arial",sans-serif;mso-ansi-language:EN-US'>PID
    myPID(&amp;Input, &amp;Output, &amp;Setpoint_Rb, Rb_Kp, Rb_Ki, Rb_Kd,
    DIRECT);<o:p></o:p></span></p>
    <p class=MsoNormal align=left style='text-align:left;line-height:150%'><span
    lang=EN-US style='font-size:9.0pt;mso-bidi-font-size:12.0pt;line-height:
    150%;font-family:"Arial",sans-serif;mso-ansi-language:EN-US'>PID myPID(&amp;Input,
    &amp;Output, &amp;Setpoint_Rc, Rc_Kp, Rc_Ki, Rc_Kd, DIRECT);</span><span
    lang=EN-US style='mso-ansi-language:EN-US'><o:p></o:p></span></p>
    <p class=papertitle style='margin-bottom:0cm;margin-bottom:.0001pt'><span
    lang=EN-US><o:p>&nbsp;</o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span lang=EN-US
    style='font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:"Calibri",sans-serif;
    mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;
    mso-bidi-font-family:"Times New Roman";mso-bidi-theme-font:minor-bidi;
    mso-bevel-captop-bevelstyle:12;mso-bevel-captop-dpiwidth:4.5pt;mso-bevel-captop-dpiheight:
    3.0pt;mso-bevel-capbot-bevelstyle:0;mso-bevel-capbot-dpiwidth:0pt;
    mso-bevel-capbot-dpiheight:0pt;mso-bevel-material:8;mso-bevel-dpiextrusion:
    4.5pt;mso-bevel-dpicontour:0pt;mso-ansi-language:EN-US'><o:p>&nbsp;</o:p></span></p>
    </div>

    mso-ansi-language:EN-US;mso-fareast-language:AR-SA;mso-no-proof:no'><o:p></o:p></span></b></h1>
    <p class=papertitle style='margin-bottom:0cm;margin-bottom:.0001pt;
    text-align:justify;line-height:115%'><span lang=EN-US style='font-size:
    12.0pt;line-height:115%;font-family:"Arial",sans-serif;mso-fareast-font-family:
    SimSun'>The developed system is based on a closed container with a
    transient air flow, in order to determine at certain times in a confined
    and known space, a thermal condition that allows us to make measurements
    under controlled and stable conditions, however the thermodynamic laws of
    energy and matter exchange are applied since the system takes and exchanges
    these conditions frequently. In this case there are exchanges of energy
    between hot and cold objects or air, vapor and oxygen molecules.<o:p></o:p></span></p>
    <p class=papertitle style='margin-bottom:0cm;margin-bottom:.0001pt'><span

    4.5pt;mso-bevel-dpicontour:0pt'><o:p>&nbsp;</o:p></span></p>

 <v:textbox>
  <![if !mso]>
  <table cellpadding=0 cellspacing=0 width="100%">
   <tr>
    <td><![endif]>
    <div>
    <p class=MsoNormal style='text-align:justify;line-height:115%'><span
    lang=EN-US style='font-size:12.0pt;line-height:115%;font-family:"Arial",sans-serif;
    mso-ansi-language:EN-US'>Figure 3.1 shows the set of the devices and system
    elements located in the top cover. <o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify;line-height:115%'><span
    lang=EN-US style='font-size:12.0pt;line-height:115%;font-family:"Arial",sans-serif;
    mso-ansi-language:EN-US'>Air cooling system:<span
    style='mso-spacerun:yes'>  </span>it is composed of a Peltier cell and its
    respective heatsink with a fan to expel the heat.<o:p></o:p></span></p>
    <p class=MsoListParagraphCxSpFirst style='margin-left:18.0pt;mso-add-space:
    auto;text-align:justify;text-indent:-18.0pt;line-height:115%;mso-list:l0 level1 lfo2'><![if !supportLists]><span
    lang=EN-US style='font-size:12.0pt;line-height:115%;font-family:Symbol;
    mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol'><span
    style='mso-list:Ignore'>·<span style='font:7.0pt "Times New Roman"'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span></span></span><![endif]><span lang=EN-US style='font-size:12.0pt;
    line-height:115%;font-family:"Arial",sans-serif'>Recirculation fan:<span
    style='mso-spacerun:yes'>  </span>this device is responsible of generating
    disturbances in the study of the controller or maintaining a transient
    state from the inlet to the outlet using a solenoid valve.<o:p></o:p></span></p>
    <p class=MsoListParagraphCxSpMiddle style='margin-left:18.0pt;mso-add-space:
    auto;text-align:justify;text-indent:-18.0pt;line-height:115%;mso-list:l0 level1 lfo2'><![if !supportLists]><span
    lang=EN-US style='font-size:12.0pt;line-height:115%;font-family:Symbol;
    mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol'><span
    style='mso-list:Ignore'>·<span style='font:7.0pt "Times New Roman"'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span></span></span><![endif]><span lang=EN-US style='font-size:12.0pt;
    line-height:115%;font-family:"Arial",sans-serif'>Current sensor: verifies
    the consumption electrical power of each actuator (Ra, <span class=SpellE>Rb</span>
    and <span class=SpellE>Rc</span>).<o:p></o:p></span></p>
    <p class=MsoListParagraphCxSpLast style='margin-left:18.0pt;mso-add-space:
    auto;text-align:justify;text-indent:-18.0pt;line-height:115%;mso-list:l0 level1 lfo2'><![if !supportLists]><span
    lang=EN-US style='font-size:12.0pt;line-height:115%;font-family:Symbol;
    mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol'><span
    style='mso-list:Ignore'>·<span style='font:7.0pt "Times New Roman"'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span></span></span><![endif]><span lang=EN-US style='font-size:12.0pt;
    line-height:115%;font-family:"Arial",sans-serif'>Solenoid valve: Final
    actuator element to control the output of hot or cold air, or also to
    create steady state or transient conditions of the air.<o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify;line-height:115%'><span
    lang=EN-US style='font-size:12.0pt;line-height:115%;font-family:"Arial",sans-serif;
    mso-ansi-language:EN-US'>Figure 3.2 shows the set of system elements
    attached to the plastic container:<o:p></o:p></span></p>
    <p class=MsoListParagraphCxSpFirst style='margin-left:18.0pt;mso-add-space:
    auto;text-align:justify;text-indent:-18.0pt;line-height:115%;mso-list:l5 level1 lfo1'><![if !supportLists]><span
    lang=EN-US style='font-size:12.0pt;line-height:115%;font-family:Symbol;
    mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol'><span
    style='mso-list:Ignore'>·<span style='font:7.0pt "Times New Roman"'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span></span></span><![endif]><span lang=EN-US style='font-size:12.0pt;
    line-height:115%;font-family:"Arial",sans-serif'>Air container: system
    designed for the study of air in closed environments through temperature
    control.<o:p></o:p></span></p>
    <p class=MsoListParagraphCxSpMiddle style='margin-left:18.0pt;mso-add-space:
    auto;text-align:justify;text-indent:-18.0pt;line-height:115%;mso-list:l5 level1 lfo1'><![if !supportLists]><span
    lang=EN-US style='font-size:12.0pt;line-height:115%;font-family:Symbol;
    mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol'><span
    style='mso-list:Ignore'>·<span style='font:7.0pt "Times New Roman"'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span></span></span><![endif]><span lang=EN-US style='font-size:12.0pt;
    line-height:115%;font-family:"Arial",sans-serif'>Dry air heater (Ra):<span
    style='mso-spacerun:yes'>  </span>this device increases the air temperature
    and add kinetic energy allowing the air particles that are on the bottom
    surface to rise and mix by pressure, the temperature range can vary from 28
    °C to 400 °C depending on the application.<o:p></o:p></span></p>
    <p class=MsoListParagraphCxSpMiddle style='margin-left:18.0pt;mso-add-space:
    auto;text-align:justify;text-indent:-18.0pt;line-height:115%;mso-list:l5 level1 lfo1'><![if !supportLists]><span
    lang=EN-US style='font-size:12.0pt;line-height:115%;font-family:Symbol;
    mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol'><span
    style='mso-list:Ignore'>·<span style='font:7.0pt "Times New Roman"'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span></span></span><![endif]><span lang=EN-US style='font-size:12.0pt;
    line-height:115%;font-family:"Arial",sans-serif'>Sensors: dry temperature,
    cooling temperature, system temperature, atmospheric pressure inside and
    outside the system, external temperature and internal and external airflow
    from the environment.<o:p></o:p></span></p>
    <p class=MsoListParagraphCxSpMiddle style='margin-left:18.0pt;mso-add-space:
    auto;text-align:justify;text-indent:-18.0pt;line-height:115%;mso-list:l5 level1 lfo1'><![if !supportLists]><span
    lang=EN-US style='font-size:12.0pt;line-height:115%;font-family:Symbol;
    mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol'><span
    style='mso-list:Ignore'>·<span style='font:7.0pt "Times New Roman"'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span></span></span><![endif]><span lang=EN-US style='font-size:12.0pt;
    line-height:115%;font-family:"Arial",sans-serif'>System cooler: Used to
    verify the responses of the data sheet sensors at low temperature, also to
    simulate environments where the temperature can be between 5 °C and 20 °C.<o:p></o:p></span></p>
    <p class=MsoListParagraphCxSpLast style='margin-left:18.0pt;mso-add-space:
    auto;text-align:justify;text-indent:-18.0pt;line-height:115%;mso-list:l5 level1 lfo1'><![if !supportLists]><span
    lang=EN-US style='font-size:12.0pt;line-height:115%;font-family:Symbol;
    mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol'><span
    style='mso-list:Ignore'>·<span style='font:7.0pt "Times New Roman"'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span></span></span><![endif]><span lang=EN-US style='font-size:12.0pt;
    line-height:115%;font-family:"Arial",sans-serif'>Ambient air fan: used to
    introduce ambient air into the system, also to homogenize and monitor the
    internal air and change the state of the actuator Ra, <span class=SpellE>Rb</span>,
    <span class=SpellE>Rc</span> inside the container.<o:p></o:p></span></p>
    <p class=MsoNormal style='mso-margin-top-alt:auto;mso-margin-bottom-alt:
    auto'><span lang=EN-US style='font-size:12.0pt;mso-bidi-font-size:11.0pt;
    font-family:"Calibri",sans-serif;mso-ascii-theme-font:minor-latin;
    mso-hansi-theme-font:minor-latin;mso-bidi-font-family:"Times New Roman";

    mso-bevel-capbot-dpiwidth:0pt;mso-bevel-capbot-dpiheight:0pt;mso-bevel-material:
    8;mso-bevel-dpiextrusion:4.5pt;mso-bevel-dpicontour:0pt;mso-ansi-language:
    EN-US'><o:p>&nbsp;</o:p></span></p>
    </div>
    <![if !mso]></td>

    mso-ansi-language:ES;mso-fareast-language:AR-SA;mso-no-proof:no'>THE SYSTEM

    <p class=MsoNormal style='text-align:justify'><span lang=EN-US
    style='font-size:12.0pt;mso-bidi-font-size:10.0pt;font-family:"Arial",sans-serif;
    mso-ansi-language:EN-US'>The Matworks® software tools used were Simulink,
    Sisotools, Stateflow and Matlab to check the mathematical model, the
    transfer function and the PID control algorithm. Furthermore, with Simulink
    the transfer function response curve without the regulation of the
    controller parameters, and then the resulting curve compared with the
    values &#8203;&#8203;P, I, D, after setting the PID values. The Sisotools
    software was used as a graphical tool to analyze the linear first order
    system. The controller gain is then modified to change the controller
    overshoot.<o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span lang=EN-US
    style='font-size:12.0pt;mso-bidi-font-size:10.0pt;font-family:"Arial",sans-serif;
    mso-ansi-language:EN-US'>The data flow and state diagrams were modeled
    using the Stateflow software in order to compare the theoretical data with
    the real model and validate the design concept. Finally, Matlab was used to
    solve the first-order differential equation.<o:p></o:p></span></p>

    <p class=papertitle style='mso-margin-top-alt:auto;mso-margin-bottom-alt:
    auto;text-align:justify'><span lang=EN-US style='font-size:12.0pt;
    font-family:"Arial",sans-serif'>In order to generate a modeling theory for
    a system like this, it is necessary once the conceptual idea, the
    phenomena, the variables and some aspects of operation are known, the next
    objective is to model a system, to characterize it mathematically and find
    a way to describe it more thoroughly in a more complete, precise, detailed
    and exact way, with all this information it will be used to perform
    analyses and generate all of the automatic controllers and also the
    algorithms seeking that the operation is adapted to the requirements
    proposed for the interested public. It is essential to obtain physical data
    and numbers for the mathematical model the container, volume, weight, area
    and some properties in our case it consists of a series of equations that
    represent the behavior of the system, a thermal or thermodynamic section,
    another section on electronic design and device control, another section on
    control algorithms, proportional, integral and derivative, as can be seen
    all these equations do not represent a single model, each one has different
    representations on the system but they act in a different way, table 3
    shows for example the heats of skin, blood, bones and muscles.<o:p></o:p></span></p>
    <p class=papertitle style='margin-bottom:0cm;margin-bottom:.0001pt;
    text-align:justify'><span lang=EN-US><o:p>&nbsp;</o:p></span></p>
    <p class=papertitle style='mso-margin-top-alt:auto;mso-margin-bottom-alt:
    auto;text-align:justify'><span lang=EN-US style='font-size:12.0pt;
    mso-bidi-font-size:11.0pt;font-family:"Calibri",sans-serif;mso-ascii-theme-font:
    minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:"Times New Roman";
    mso-bidi-theme-font:minor-bidi;mso-bevel-captop-bevelstyle:12;mso-bevel-captop-dpiwidth:
    4.5pt;mso-bevel-captop-dpiheight:3.0pt;mso-bevel-capbot-bevelstyle:0;
    mso-bevel-capbot-dpiwidth:0pt;mso-bevel-capbot-dpiheight:0pt;mso-bevel-material:
    8;mso-bevel-dpiextrusion:4.5pt;mso-bevel-dpicontour:0pt'><o:p>&nbsp;</o:p></span></p>
    </div>

    <div>
    <p class=MsoNormal style='text-align:justify'><span lang=EN-US
    style='font-size:12.0pt;font-family:"Arial",sans-serif;mso-ansi-language:
    EN-US'>Three actuators were installed, which are necessary to cover the
    temperature ranges. This prevents an excessive use of energy, as follows:<o:p></o:p></span></p>
    <p class=MsoListParagraphCxSpFirst style='margin-bottom:0cm;margin-bottom:
    .0001pt;mso-add-space:auto;text-align:justify;text-indent:-18.0pt;
    line-height:115%;mso-list:l4 level1 lfo3'><![if !supportLists]><span
    lang=EN-US style='font-size:12.0pt;line-height:115%;font-family:Symbol;
    mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol'><span
    style='mso-list:Ignore'>·<span style='font:7.0pt "Times New Roman"'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span></span></span><![endif]><span lang=EN-US style='font-size:12.0pt;
    line-height:115%;font-family:"Arial",sans-serif'>Actuator (Ra) electrical heating
    element, connected at 220 <span class=GramE>VAC</span>, that covers the
    temperature range from 60 ° C to 270 ° C.<o:p></o:p></span></p>
    <p class=MsoListParagraphCxSpMiddle style='margin-bottom:0cm;margin-bottom:
    .0001pt;mso-add-space:auto;text-align:justify;text-indent:-18.0pt;
    line-height:115%;mso-list:l4 level1 lfo3'><![if !supportLists]><span
    lang=EN-US style='font-size:12.0pt;line-height:115%;font-family:Symbol;
    mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol'><span
    style='mso-list:Ignore'>·<span style='font:7.0pt "Times New Roman"'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span></span></span><![endif]><span lang=EN-US style='font-size:12.0pt;
    line-height:115%;font-family:"Arial",sans-serif'>Actuator (<span
    class=SpellE>Rb</span>) electrical heating element connected at 12 VDC,
    that covers the temperature range from 25 ° C to 60 ° C.<o:p></o:p></span></p>
    <p class=MsoListParagraphCxSpLast style='margin-bottom:0cm;margin-bottom:
    .0001pt;mso-add-space:auto;text-align:justify;text-indent:-18.0pt;
    line-height:115%;mso-list:l4 level1 lfo3'><![if !supportLists]><span
    lang=EN-US style='font-size:12.0pt;line-height:115%;font-family:Symbol;
    mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol'><span
    style='mso-list:Ignore'>·<span style='font:7.0pt "Times New Roman"'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span></span></span><![endif]><span lang=EN-US style='font-size:12.0pt;
    line-height:115%;font-family:"Arial",sans-serif'>Actuator (<span
    class=SpellE>Rc</span>) Peltier module, connected at 12 VDC, that covers
    the temperature range from 25 ° C to -10 ° C.<o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span lang=EN-US
    style='font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:"Calibri",sans-serif;

    style='mso-bookmark:_Toc189487034'><b><span lang=ES style='font-size:12.0pt;
    mso-bidi-font-size:16.0pt;font-family:"Arial",sans-serif;mso-fareast-font-family:

    style='mso-bookmark:_Toc189487034'><b><span lang=ES style='font-size:12.0pt;
    mso-bidi-font-size:16.0pt;font-family:"Arial",sans-serif;mso-fareast-font-family:
    "Times New Roman";font-variant:normal !important;mso-font-kerning:16.0pt;
    mso-ansi-language:ES;mso-fareast-language:AR-SA;mso-no-proof:no'>METHODOLOGY
    APPLIED</span></b></span><b><span lang=ES style='font-size:12.0pt;
    mso-bidi-font-size:16.0pt;font-family:"Arial",sans-serif;mso-fareast-font-family:
    "Times New Roman";font-variant:normal !important;mso-font-kerning:16.0pt;
    mso-ansi-language:ES;mso-fareast-language:AR-SA;mso-no-proof:no'><o:p></o:p></span></b></h1>
    <p class=MsoNormal style='text-align:justify'><span lang=EN-US
    style='font-size:12.0pt;font-family:"Arial",sans-serif;mso-ansi-language:
    EN-US'>The methodology used to achieve the operation, construction and
    start-up of CACOTE, which consists of the development and operation of a
    PID temperature controller in a closed space for testing low-cost sensors,
    was the following:<o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span lang=EN-US
    style='font-size:12.0pt;font-family:"Arial",sans-serif;mso-ansi-language:
    EN-US'><o:p>&nbsp;</o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span lang=EN-US
    style='font-size:12.0pt;font-family:"Arial",sans-serif;mso-ansi-language:
    EN-US'>A proposal for a thermal system to test sensors, devices, materials
    and biological elements was studied, a list of requirements was made, then
    the physical and chemical phenomena were determined, the conceptual idea
    was developed, the composition of the system and some elements such as
    actuators and sensors, followed by a possible presentation of the system
    and some accessories, part of the electrical system was tested such as
    voltages and currents in the actuators, some important temperature and
    humidity sensors were reviewed, then the theoretical model was made, the
    thermal model was passed, the system was tested, it was mathematically
    modeled and then tests and validations were carried out.<o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span lang=EN-US
    style='font-size:12.0pt;font-family:"Arial",sans-serif;mso-ansi-language:
    EN-US'><o:p>&nbsp;</o:p></span></p>
    <p class=papertitle style='mso-margin-top-alt:auto;mso-margin-bottom-alt:
    auto;text-align:justify'><span lang=EN-US style='font-size:12.0pt;

    mso-ansi-language:ES;mso-fareast-language:AR-SA;mso-no-proof:no'>PID

    mso-ansi-language:ES;mso-fareast-language:AR-SA;mso-no-proof:no'><o:p></o:p></span></b></h1>
    <p class=MsoNormal style='text-align:justify'><span lang=EN-US
    style='font-size:12.0pt;font-family:"Arial",sans-serif;mso-ansi-language:
    EN-US'>In order to observe the dynamic behavior and inertia of the system,
    data was captured in different scenarios. The first scenario consisted in
    heating the air with the low-power resistance (5 watts). The second in
    heating the air with the high-power resistance (150 watts). The third was
    to cool naturally by disconnecting the heaters until reaching ambient
    temperature (the slope of the temperature versus time curve is moderate and
    governed by the heat losses through the walls of the container). Finally,
    the fourth scenario consisted of the cooling process through the Peltier
    modules. It can inferred that the internal fan was able to homogenize the
    internal temperature by mixing the hot air around the heaters. The (</span><span
    lang=ES-CO style='font-size:12.0pt;font-family:"Arial",sans-serif;
    mso-ansi-language:ES-CO'>&#946;</span><span lang=EN-US style='font-size:
    12.0pt;font-family:"Arial",sans-serif;mso-ansi-language:EN-US'>), (</span><span
    lang=ES-CO style='font-size:12.0pt;font-family:"Arial",sans-serif;
    mso-ansi-language:ES-CO'>&#945;</span><span lang=EN-US style='font-size:
    12.0pt;font-family:"Arial",sans-serif;mso-ansi-language:EN-US'>), (</span><span
    lang=ES-CO style='font-size:12.0pt;font-family:"Arial",sans-serif;
    mso-ansi-language:ES-CO'>&#1046;</span><span lang=EN-US style='font-size:
    12.0pt;font-family:"Arial",sans-serif;mso-ansi-language:EN-US'>), (&#359;),
    (&#428;), (Y), values &#8203;&#8203;were determined and recorded in table
    1. Then the system was simulated, obtaining a transfer function for each
    scenario or segment of the process (the actuators and some thermal
    parameters change in each scenario).<o:p></o:p></span></p>

    <p class=papertitle style='margin-bottom:0cm;margin-bottom:.0001pt;
    text-align:justify;line-height:115%'><span lang=EN-US style='font-size:
    12.0pt;line-height:115%;font-family:"Arial",sans-serif;mso-fareast-font-family:
    SimSun'>The developed system is based on a closed container with a
    transient air flow, in order to determine at certain times in a confined
    and known space, a thermal condition that allows us to make measurements
    under controlled and stable conditions, however the thermodynamic laws of
    energy and matter exchange are applied since the system takes and exchanges
    these conditions frequently. In this case there are exchanges of energy
    between hot and cold objects or air, vapor and oxygen molecules.<o:p></o:p></span></p>

    <p class=MsoNormal align=left style='text-align:left;line-height:115%'><a
    name="_Hlk189573551"><span style='font-size:12.0pt;line-height:115%;
    font-family:"Arial",sans-serif;mso-ansi-language:EN-US'><span
    style='mso-spacerun:yes'> </span><span lang=EN-US><span
    style='mso-spacerun:yes'>         </span>There are three types of systems
    in thermodynamics: open, closed and isolated.<o:p></o:p></span></span></a></p>
    <p class=MsoListParagraphCxSpFirst style='margin-left:54.0pt;mso-add-space:
    auto;text-align:justify;text-indent:-18.0pt;mso-list:l6 level2 lfo4'><span
    style='mso-bookmark:_Hlk189573551'><![if !supportLists]><span lang=EN-US
    style='font-size:12.0pt;line-height:107%;font-family:"Arial",sans-serif;
    mso-fareast-font-family:Arial;mso-no-proof:yes'><span style='mso-list:Ignore'>a.<span
    style='font:7.0pt "Times New Roman"'>&nbsp;&nbsp;&nbsp; </span></span></span><![endif]><span
    lang=EN-US style='font-size:12.0pt;line-height:107%;font-family:"Arial",sans-serif;
    mso-fareast-font-family:SimSun;mso-no-proof:yes'>When this container works
    with the lid open, it can be defined as an open system that exchanges
    energy (when the resistors Ra, Rb, Rc are heated) and matter (in this case,
    air containing oxygen and water molecules is used), all of this with its
    environment (in our case, the laboratory).<o:p></o:p></span></span></p>
    <p class=MsoListParagraphCxSpMiddle style='margin-left:54.0pt;mso-add-space:
    auto;text-align:justify;text-indent:-18.0pt;mso-list:l6 level2 lfo4'><span
    style='mso-bookmark:_Hlk189573551'><![if !supportLists]><span lang=EN-US
    style='font-size:12.0pt;line-height:107%;font-family:"Arial",sans-serif;
    mso-fareast-font-family:Arial;mso-no-proof:yes'><span style='mso-list:Ignore'>b.<span
    style='font:7.0pt "Times New Roman"'>&nbsp;&nbsp;&nbsp; </span></span></span><![endif]><span
    lang=EN-US style='font-size:12.0pt;line-height:107%;font-family:"Arial",sans-serif;
    mso-fareast-font-family:SimSun;mso-no-proof:yes'>When this container system
    has its lid closed, it behaves like a closed system (theoretically), and on
    the contrary, it can only exchange energy with its surroundings (i.e. with
    the container walls, resistors, fans and contents, sensors), but this
    system does not materialize in real conditions. The pressure opens the lid
    and the temperature after 121 ºC deforms the lid and the container, heating
    the entire surface, so in theory it would approach a closed system. <o:p></o:p></span></span></p>
    <p class=MsoListParagraphCxSpLast style='margin-left:54.0pt;mso-add-space:
    auto;text-align:justify;text-indent:-18.0pt;mso-list:l6 level2 lfo4'><span
    style='mso-bookmark:_Hlk189573551'><![if !supportLists]><span lang=EN-US
    style='font-size:12.0pt;line-height:107%;font-family:"Arial",sans-serif;
    mso-fareast-font-family:Arial;mso-no-proof:yes'><span style='mso-list:Ignore'>c.<span
    style='font:7.0pt "Times New Roman"'>&nbsp;&nbsp;&nbsp; </span></span></span><![endif]><span
    lang=EN-US style='font-size:12.0pt;line-height:107%;font-family:"Arial",sans-serif;
    mso-fareast-font-family:SimSun;mso-no-proof:yes'>It could also be used as
    an isolated system, which is one that cannot exchange matter or energy with
    its surroundings, which could theoretically work. However, a perfect
    isolated system is unlikely, but the behavior of such a system is like a
    thermos cup with a lid and could be conceptually similar to a true isolated
    system. The elements inside can exchange energy with each other, which
    explains why drinks get colder and ice melts a little, but they exchange
    very little energy (heat) with the outside environment. <o:p></o:p></span></span></p>
    <span style='mso-bookmark:_Hlk189573551'></span>
    <p class=papertitle style='margin-bottom:0cm;margin-bottom:.0001pt;

    SimSun'><o:p>&nbsp;</o:p></span></p>

    EN-US'><o:p>&nbsp;</o:p></span></p>

    <p class=tablecopy style='mso-margin-top-alt:auto;mso-margin-bottom-alt:
    auto'><span lang=EN-US style='font-size:12.0pt;font-family:"Arial",sans-serif'>Before
    making the physical model it is necessary to present a little the idea with
    some implements that are available, to see the feasibility and see if the
    realization would be possible, it is like a small materialization of the
    idea, to then produce the physical model comprises several aspects of
    utmost importance: the first consists of finding the dynamic
    characteristics of the system according to mathematical theory, in a case
    like this it is necessary to model the thermal system first, then follow
    the experimental developments and obtain the values &#8203;&#8203;&#8203;&#8203;of
    the previous tables of the system or the plant; to then make approximations
    under valid criteria that simplify the result obtained.<o:p></o:p></span></p>

    style='font-size:12.0pt;mso-bidi-font-size:16.0pt;font-family:"Arial",sans-serif;
    mso-fareast-font-family:Arial;font-variant:normal !important;mso-font-kerning:

    lang=ES style='font-size:12.0pt;mso-bidi-font-size:16.0pt;font-family:"Arial",sans-serif;
    mso-fareast-font-family:"Times New Roman";font-variant:normal !important;
    mso-font-kerning:16.0pt;mso-ansi-language:ES;mso-fareast-language:AR-SA;
    mso-no-proof:no'>DETERMINATION OF PHYSICAL PHENOMENA</span></b></a><b><span
    lang=ES style='font-size:12.0pt;mso-bidi-font-size:16.0pt;font-family:"Arial",sans-serif;
    mso-fareast-font-family:"Times New Roman";font-variant:normal !important;
    mso-font-kerning:16.0pt;mso-ansi-language:ES;mso-fareast-language:AR-SA;
    mso-no-proof:no'><o:p></o:p></span></b></h1>
    <p class=papertitle style='mso-margin-top-alt:auto;mso-margin-bottom-alt:
    auto;text-align:justify;page-break-after:avoid'><span lang=EN-US
    style='font-size:12.0pt;font-family:"Arial",sans-serif;mso-fareast-font-family:
    SimSun'>Physical phenomenon and conceptual idea of &#8203;&#8203;the
    system, in reality the phenomenon is based on temperature with volume, constant
    pressure, where the equation of the law of gases can be used, for this the
    need of a system that allows generating temperature ramps from room
    temperature to about 120ºC of temperature is defined. Some requirements are
    that the volume and pressure are constant and that the system is closed to
    allow measuring sensors, devices, biological material and their responses
    in temperature with conditions of constant pressure and volume and thus
    find the mass (only applies to biological materials). On the other hand,
    the system must allow going from room temperature to -10 ºC to test other
    materials or liquids and see if fractures are created. The system must be
    able to go from high to low temperature, and from low to high, also
    allowing stability at a temperature over time. In addition to all this,
    applications such as incubation periods for biological material,
    temperature ramps, temperature inversion and stability for periods,
    creation of controlled disturbances, maximum and minimum values, all these
    conditions, must be considered. Other aspects also come into play, such as
    costs and the public to which the development is directed.<o:p></o:p></span></p>

  src="index_file/image035.png"
  alt="Elaborazione alternativa: 12.	DETERMINATION OF PHYSICAL PHENOMENA&#13;&#10;Physical phenomenon and conceptual idea of the system, in reality the phenomenon is based on temperature with volume, constant pressure, where the equation of the law of gases can be used, for this the need of a system that allows generating temperature ramps from room temperature to about 120ºC of temperature is defined. Some requirements are that the volume and pressure are constant and that the system is closed to allow measuring sensors, devices, biological material and their responses in temperature with conditions of constant pressure and volume and thus find the mass (only applies to biological materials). On the other hand, the system must allow going from room temperature to -10 ºC to test other materials or liquids and see if fractures are created. The system must be able to go from high to low temperature, and from low to high, also allowing stability at a temperature over time. In addition to all this, applications such as incubation periods for biological material, temperature ramps, temperature inversion and stability for periods, creation of controlled disturbances, maximum and minimum values, all these conditions, must be considered. Other aspects also come into play, such as costs and the public to which the development is directed.&#13;&#10;&#13;&#10;"

  src="index_file/image053.png"
  alt="Elaborazione alternativa: In summary, our system is a closed system with a transient flow of air and energy, managed by solenoid valves that open and close the system, to exchange energy and water vapor.&#13;&#10;&#13;&#10;For the initial state, the constant volume of the container is considered as known, the medium will be air because variables such as density, temperature and humidity are equal inside and outside the chamber in the first interval from room temperature to 60 °C. The 5 watts electric heating element (Ra) is the actuator in this temperature zone, then the 150-watt electric heating element to heat the systems up to 200°C and finally the cooling effect (Rc). It is better to let the system start from rest at room temperature, using equation 1, [17].&#13;&#10;Qcco=[(Qsap1+Qsap2+ Qsap3)-Qstta-Qsicav-Qfm-Qpcon)]*(1+F)       Eq-1&#13;&#10;&#13;&#10;&#13;&#10;&#13;&#10;"

  <td colspan=2></td>
  <td colspan=39 align=left valign=top><img width=737 height=530
  src="index_file/image056.png"
  alt="Elaborazione alternativa: 9.	TESTING AND VALIDATION&#13;&#10;	The set of data obtained experimentally in this work, can serve as a benchmark in optimization processes of closed loop control algorithms in closed chamber thermal application systems, which includes a wide variety of thermal processes.&#13;&#10;	The three mathematical models can be used in a wide range of applications, even in larger volumes but preserving the same geometry, because in the system includes the losses by enclosures, infiltrations of air, and losses by isolation; this allows to keep the system stable, scalable, easy installation and affordable.&#13;&#10;	The calibration curves of this work can be compared with systems that have the same thermal behavior, the same geometry and volume scalability. When comparing the data of this experiment with those of a new system that is built with actuators and sensors of similar characteristics, it will be possible to establish relationships between the proposed model and the new data, according to the measurement scale.&#13;&#10;	Additionally, the first order PID control algorithm applied in the thermal systems for each of the actuators includes technical applications in dehydration, cooling, incubation and thermal cycles in ovens.&#13;&#10;	The electronics and hardware is open source as well as the software for processing the digital control signals and the delayed times processed to optimize the output of the actuators during the heating and cooling cycles.&#13;&#10;&#13;&#10;&#13;&#10;"
  v:shapes="_x0000_s1043"></td>

  src="index_file/image058.png"
  alt="Elaborazione alternativa: 	PID CONTROL ALGORITHMS&#13;&#10;In order to observe the dynamic behavior and inertia of the system, data was captured in different scenarios. The first scenario consisted in heating the air with the low-power resistance (5 watts). The second in heating the air with the high-power resistance (150 watts). The third was to cool naturally by disconnecting the heaters until reaching ambient temperature (the slope of the temperature versus time curve is moderate and governed by the heat losses through the walls of the container). Finally, the fourth scenario consisted of the cooling process through the Peltier modules. It can inferred that the internal fan was able to homogenize the internal temperature by mixing the hot air around the heaters. The (&#946;), (&#945;), (&#1046;), (&#359;), (&#428;), (Y), values were determined and recorded in table 1. Then the system was simulated, obtaining a transfer function for each scenario or segment of the process (the actuators and some thermal parameters change in each scenario).&#13;&#10;G(s)=Z/(NS+M)       Eq- 2 using the resistance Ra: 48 &#120744; to 220 Vac  G(s)=4,94/(2,78S+1,72)         Eq- 3  &#13;&#10;&#13;&#10;G(s)=C/(As+B)    Eq- 4 using the resistance Rb: 220 &#120744; to 12 Vdc   G(s)=4,94/(4,826S+0,583)      Eq- 5  &#13;&#10;&#13;&#10;G(s)=F/(Ds+E)        Eq- 6 using the resistance Rc: 1,98 &#120744; to 12 Vdc   G(s)=36/(12,42s+7,27)       Eq- 7   &#13;&#10;&#13;&#10;&#13;&#10;&#13;&#10;"
  v:shapes="_x0000_s1045"></td>

  src="index_file/image060.png"
  alt="Elaborazione alternativa: 6.	FIRMWARE ELECTRONIC DEVELOPMENT&#13;&#10;&#13;&#10;The following is a piece of code, structure of the control system in Arduino:&#13;&#10;//::::::::  PID CONTROL DEFINITIONS   :::::::::::::::::::::::::::::::::::::::::::// &#13;&#10;/**********   actuator (Ra) resistance to 220 Vac  ************************************/&#13;&#10;/**********  Ra: 48 ==&gt; to 220 Vac ==&gt; G(s)=4,94/(2,78S+1,72) ***************************/&#13;&#10;double Ra_Kp=0.4590, Ra_Ki=0.4805, Ra_Kd=-0.1539; //initial parameters, control arguments&#13;&#10;/************   actuator (Rb) resistance to 12 Vdc  *************************************/&#13;&#10;/**********  Rb: 220 ==&gt; to 12 Vdc ==&gt; G(s)=4,94/(4,826S+0,583) ************************/&#13;&#10;double Rb_Kp=0.1556, Rb_Ki=0.0318, Rb_Kd=-0.2672; //initial parameters, control arguments&#13;&#10;/************   actuator (Rc) Peltier cell at 12 Vdc  ***********************************/&#13;&#10;/**********  Rc: 1,98 ==&gt; to 12 Vdc ==&gt; G(s)=36/(12,42s+7,27) **************************/&#13;&#10;double Rc_Kp=0.2662, Rc_Ki=0.2637, Rc_Kd=-0.0943; //initial parameters, control arguments&#13;&#10;float temperature=0;&#13;&#10;unsigned long Resp_Last_Temp = 0;&#13;&#10;unsigned long Last_PID_Calc = 0;&#13;&#10;float Ant_Temp = -9999.0;&#13;&#10;&#13;&#10;PID myPID(&amp;Input, &amp;Output, &amp;Setpoint_Ra, Ra_Kp, Ra_Ki, Ra_Kd, DIRECT);&#13;&#10;PID myPID(&amp;Input, &amp;Output, &amp;Setpoint_Rb, Rb_Kp, Rb_Ki, Rb_Kd, DIRECT);&#13;&#10;PID myPID(&amp;Input, &amp;Output, &amp;Setpoint_Rc, Rc_Kp, Rc_Ki, Rc_Kd, DIRECT);&#13;&#10;&#13;&#10;&#13;&#10;"
